import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../Styles/style0.css';
import {FaBlackberry} from 'react-icons/fa';
import {Card, Button} from 'react-bootstrap';
import reactDom from 'react-dom';
const About = () => {
    // const clickHandler = () => {
    //     reactDom.createPortal(
    //         <div class="col">
    //         <Card style={{ width: '18rem' }}>
    //             <Card.Img variant="top" src="holder.js/100px180" />
    //             <Card.Body>
    //                 <Card.Title>Card Title</Card.Title>
    //                 <Card.Text>
    //                     Some quick example text to build on the card title and make up the bulk of
    //                     the card's content.
    //             </Card.Text>
    //                 <Button variant="primary">Go somewhere</Button>
    //             </Card.Body>
    //         </Card>
    //         </div> ,
    //         document.getElementById("root")
    //     )
    // }
    return (
        <div>
            <h1 className="text-center">About <FaBlackberry /> </h1>
            <div class="row row-cols-1 row-cols-md-3 g-4">
                <div class="col">
                    <Card style={{ width: '18rem' }}>
                        <Card.Img variant="top" src="holder.js/100px180" />
                        <Card.Body>
                            <Card.Title>Card Title</Card.Title>
                            <Card.Text>
                                Some quick example text to build on the card title and make up the bulk of
                                the card's content.
                            </Card.Text>
                            <Button variant="primary">Go somewhere</Button>
                        </Card.Body>
                    </Card>
                </div>
                <div class="col">
                    <Card style={{ width: '18rem' }}>
                        <Card.Img variant="top" src="holder.js/100px180" />
                        <Card.Body>
                            <Card.Title className={`fontXl`}>Card Title</Card.Title>
                            <Card.Text>
                                Some quick example text to build on the card title and make up the bulk of
                                the card's content.
                            </Card.Text>
                            <Button variant="primary">Go somewhere</Button>
                        </Card.Body>
                    </Card>
                </div>
                <div class="col">
                        <Card style={{ width: '18rem' }}>
                            <Card.Img variant="top" src="holder.js/100px180" />
                            <Card.Body>
                                <Card.Title>Card Title</Card.Title>
                                <Card.Text>
                                    Some quick example text to build on the card title and make up the bulk of
                                    the card's content.
                            </Card.Text>
                                <Button variant="primary">Go somewhere</Button>
                            </Card.Body>
                        </Card>
                </div>   
                <div class="col">
                    <Button variant="info" onClick={  
                        reactDom.createPortal(
                            // <div class="col">
                            <Card style={{ width: '18rem' }}>
                                <Card.Img variant="top" src="holder.js/100px180" />
                                <Card.Body>
                                    <Card.Title>Card Title</Card.Title>
                                    <Card.Text>
                                        Some quick example text to build on the card title and make up the bulk of
                                        the card's content.
                                </Card.Text>
                                    <Button variant="primary">Go somewhere</Button>
                                </Card.Body>
                            </Card>,
                            /* </div> , */
                            document.getElementById("root"))
                    }> + </Button>
                </div>             
            </div>
        </div>
    );
};

export default About;
